Pull request to fix AntConfiguration flow when a build file is added.

Currently the build file is marked as Ant file prior to inner structure validation. 

    AntSupport.markFileAsAntFile(file, xmlFile.getProject(), true);

It means that although the validation is performed, it does not throw an exception for build files without required attributes.

    if (!AntDomFileDescription.isAntFile(((XmlFile)xmlFile))) {
      throw new AntNoFileException("the file is not recognized as an ANT file", file);
    }

The flow just falls to less strict check and hence the invalid Ant build file is added. Due to the previous call of marking the file as Ant file, pretty much any XML file can be added as Ant file.

    if (vFile != null && ForcedAntFileAttribute.isAntFile(vFile)) {
      return true;
    }

I changed the order that marking the file as Ant file is happening after the inner structure validation.

When importing dependencies from Gradle Intellij identifies them by 'groupId:artifactId:version[:classifier]'. While being sufficient for conventional layouts, it still may fail with custom Ivy repositories. Consider the following example:
```groovy
apply plugin: 'java'
repositories {
    ivy {
        ivyPattern 'http://teamcity.jetbrains.com/guestAuth/repository/download/[module]/[revision]/teamcity-ivy.xml'
        artifactPattern 'http://teamcity.jetbrains.com/guestAuth/repository/download/[module]/[revision]/[artifact](.[ext])'
    }
}

dependencies {
    compile ( 'org:bt345:lastSuccessful' ){
        artifact {
            name = 'kotlin-compiler-0.9.712'
            type = 'zip'
        }
    }
    compile ( 'org:bt345:lastSuccessful' ){
        artifact {
            name = 'kotlin-compiler-for-maven'
            type = 'jar'
        }
    }
} 
```
Upon import Intellij creates only one of these deps, ignoring the second one as a duplicate. Proposed fix addresses the problem by appending a filename for dependencies which does not follow Maven naming convention.
